&quot;God Love Her&quot; is the title of a song co-written and recorded by American country music artist Toby Keith, found on his 2008 album, That Don't Make Me a Bad Guy, from which it was released as the second single and on the chart week of March 7, 2009, the song became Keith's eighteenth Number One song on the Hot Country Songs chart. Keith co-wrote the song with Vicky McGehee.

&quot;God Love Her&quot; is a moderate up-tempo accompanied by electric guitar. It describes the narrator's love for a preacher's daughter, who despite her own rebellious nature (&quot;she was baptized in dirty water&quot;) saves the narrator's &quot;soul from the devil&quot;.

